CREATE TABLE moves (
    id INT PRIMARY KEY,
    name VARCHAR(50) NOT NULL,
    power INT,
    pp INT,
    accuracy INT,
    priority INT,
    move_effect_chance INT,
    generation_id INT,
    move_damage_class_id INT,
    move_effect_id INT,
    move_target_id INT,
    type_id INT,
    contest_effect_id INT,
    contest_type_id INT,
    super_contest_effect_id INT,
    FOREIGN KEY (generation_id) REFERENCES generations(id),
    FOREIGN KEY (move_damage_class_id) REFERENCES moves_damage_classes(id),
    FOREIGN KEY (move_effect_id) REFERENCES moves_effects(id),
    FOREIGN KEY (move_target_id) REFERENCES moves_targets(id),
    FOREIGN KEY (type_id) REFERENCES types(id),
    FOREIGN KEY (contest_effect_id) REFERENCES contests_effects(id),
    FOREIGN KEY (contest_type_id) REFERENCES contests_types(id),
    FOREIGN KEY (super_contest_effect_id) REFERENCES super_contests_effects(id)
);


